import React from "react";

function Site() {
  return (
    <PageWrapper >
      <p>Welcome to Ayisha's world 1</p>
    </PageWrapper>
  );
}

export default Site;


const PageWrapper = styled.div`
display: grid;
font-size: 2rem
grid-template-rows: 3rem 1fr;
grid-gap: 1rem;
grid-template-areas: 
'nav'
'content'
;
`;
